import {  Container } from 'react-bootstrap';


export default function Home()  {
    return (
        <div>
            <h3 className="my-5">Bem-vindo à nossa loja virtual!</h3>
            <Container>
                <img src={Home_img} alt="animação da página home"/>
            </Container>
        </div>

    );
}
